/a> \u043e\u0442\u043f\u0440\u0430\u0432\u0438\u043b\u0441\u044f \u0432 \u043f\u0443\u0442\u0435\u0448\u0435\u0441\u0442\u0432\u0438\u0435 \u0432\u043e\u043a\u0440\u0443\u0433 \u0441\u0432\u0435\u0442\u0430 \u043d\u0430 \u0434\u0432\u0443\u0445\u043c\u0430\u0447\u0442\u043e\u0432\u043e\u043c \u0441\u0443\u0434\u043d\u0435.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1911_%D0%B3%D0%BE%D0%B4\" title=\"1911 \u0433\u043e\u0434\">1911<\/a>&#160;\u2014 \u0432 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%B0%D0%BD%D0%BA%D1%82-%D0%9F%D0%B5%D1%82%D0%B5%D1%80%D0%B1%D1%83%D1%80%D0%B3\" title=\"\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\">\u0421\u0430\u043d\u043a\u0442-\u041f\u0435\u0442\u0435\u0440\u0431\u0443\u0440\u0433\u0435<\/a> \u043e\u0442\u043a\u0440\u044b\u043b\u0430\u0441\u044c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9C%D0%B5%D0%B6%D0%B4%D1%83%D0%BD%D0%B0%D1%80%D0%BE%D0%B4%D0%BD%D0%B0%D1%8F_%D0%B2%D0%BE%D0%B7%D0%B4%D1%83%D1%85%D0%BE%D0%BF%D0%BB%D0%B0%D0%B2%D0%B0%D1%82%D0%B5%D0%BB%D1%8C%D0%BD%D0%B0%D1%8F_%D0%B2%D1%8B%D1%81%D1%82%D0%B0%D0%B2%D0%BA%D0%B0\" title=\"\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0432\u043e\u0437\u0434\u0443\u0445\u043e\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430\">\u041c\u0435\u0436\u0434\u0443\u043d\u0430\u0440\u043e\u0434\u043d\u0430\u044f \u0432\u043e\u0437\u0434\u0443\u0445\u043e\u043f\u043b\u0430\u0432\u0430\u0442\u0435\u043b\u044c\u043d\u0430\u044f \u0432\u044b\u0441\u0442\u0430\u0432\u043a\u0430<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1913_%D0%B3%D0%BE%D0%B4\" title=\"1913 \u0433\u043e\u0434\">1913<\/a>&#160;\u2014 \u0441\u043f\u0443\u0441\u043a \u043d\u0430 \u0432\u043e\u0434\u0443 \u00ab<a href=\"https:\/\/ru.wikipedia.org\/wiki\/RMS_Aquitania\" title=\"RMS Aquitania\">\u0410\u043a\u0432\u0438\u0442\u0430\u043d\u0438\u0438<\/a>\u00bb, \