041a\u0430\u043d\u0430\u0434\u044b<\/a> \u043f\u043e\u0441\u0442\u0430\u043d\u043e\u0432\u0438\u043b, \u0447\u0442\u043e \u0436\u0435\u043d\u0449\u0438\u043d\u044b \u043d\u0435 \u044f\u0432\u043b\u044f\u044e\u0442\u0441\u044f \u00ab\u043f\u0435\u0440\u0441\u043e\u043d\u0430\u043c\u0438\u00bb (\u0444\u0438\u0437\u0438\u0447\u0435\u0441\u043a\u0438\u043c\u0438 \u043b\u0438\u0446\u0430\u043c\u0438).<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1929_%D0%B3%D0%BE%D0%B4\" title=\"1929 \u0433\u043e\u0434\">1929<\/a>&#160;\u2014 \u0441 23 \u043f\u043e 29 \u0430\u043f\u0440\u0435\u043b\u044f \u043f\u0440\u043e\u0448\u043b\u0430 XVI \u043a\u043e\u043d\u0444\u0435\u0440\u0435\u043d\u0446\u0438\u044f <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9A%D0%BE%D0%BC%D0%BC%D1%83%D0%BD%D0%B8%D1%81%D1%82%D0%B8%D1%87%D0%B5%D1%81%D0%BA%D0%B0%D1%8F_%D0%BF%D0%B0%D1%80%D1%82%D0%B8%D1%8F_%D0%A1%D0%BE%D0%B2%D0%B5%D1%82%D1%81%D0%BA%D0%BE%D0%B3%D0%BE_%D0%A1%D0%BE%D1%8E%D0%B7%D0%B0\" title=\"\u041a\u043e\u043c\u043c\u0443\u043d\u0438\u0441\u0442\u0438\u0447\u0435\u0441\u043a\u0430\u044f \u043f\u0430\u0440\u0442\u0438\u044f \u0421\u043e\u0432\u0435\u0442\u0441\u043a\u043e\u0433\u043e \u0421\u043e\u044e\u0437\u0430\">\u0412\u041a\u041f(\u0431)<\/a>, \u043d\u0430 \u043a\u043e\u0442\u043e\u0440\u043e\u0439 \u0431\u044b\u043b \u043f\u0440\u0438\u043d\u044f\u0442 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%9F%D0%B5%D1%80%D0%B2%D0%B0%D1%8F_%D0%BF%D1%8F%D1%82%D0%B8%D0%BB%D0%B5%D1%82%D0%BA%D0%B0\" title=\"\u041f\u0435\u0440\u0432\u0430\u044f \u043f\u044f\u0442\u0438\u043b\u0435\u0442\u043a\u0430\">1-\u0439 \u043f\u044f\u0442\u0438\u043b\u0435\u0442\u043d\u0438\u0439 \u043f\u043b\u0430\u043d<\/a>.<\/li><li><a href=\"https:\/\/ru.wikipedia.org\/wiki\/1932_%D0%B3%D0%BE%D0%B4\" title=\"1932 \u0433\u043e\u0434\">1932<\/a><ul><li>\u0412 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D1%82%D1%80%D0%B0%D1%82%D1%84%D0%BE%D1%80%D0%B4-%D0%BE%D0%BD-%D0%AD%D0%B9%D0%B2%D0%BE%D0%BD\" class=\"mw-redirect\" title=\"\u0421\u0442\u0440\u0430\u0442\u0444\u043e\u0440\u0434-\u043e\u043d-\u042d\u0439\u0432\u043e\u043d\">\u0421\u0442\u0440\u0430\u0442\u0444\u043e\u0440\u0434-\u043e\u043d-\u042d\u0439\u0432\u043e\u043d\u0435<\/a> \u0431\u044b\u043b \u043e\u0442\u043a\u0440\u044b\u0442 \u041a\u043e\u0440\u043e\u043b\u0435\u0432\u0441\u043a\u0438\u0439 \u0448\u0435\u043a\u0441\u043f\u0438\u0440\u043e\u0432\u0441\u043a\u0438\u0439 \u0442\u0435\u0430\u0442\u0440, \u043a\u043e\u0442\u043e\u0440\u044b\u0439 \u043f\u0440\u043e\u0432\u043e\u0434\u0438\u0442 \u0448\u0435\u043a\u0441\u043f\u0438\u0440\u043e\u0432\u0441\u043a\u0438\u0435 \u0444\u0435\u0441\u0442\u0438\u0432\u0430\u043b\u0438.<\/li><li>\u0412 \u0441\u043e\u043e\u0442\u0432\u0435\u0442\u0441\u0442\u0432\u0438\u0438 \u0441 \u0440\u0435\u0448\u0435\u043d\u0438\u0435\u043c <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A6%D0%9A_%D0%92%D0%9A%D0%9F(%D0%B1)\" class=\"mw-redirect\" title=\"\u0426\u041a \u0412\u041a\u041f(\u0431)\">\u0426\u041a \u0412\u041a\u041f(\u0431)<\/a> \u00ab\u041e \u043f\u0435\u0440\u0435\u0441\u0442\u0440\u043e\u0439\u043a\u0435 \u043b\u0438\u0442\u0435\u0440\u0430\u0442\u0443\u0440\u043d\u043e-\u0445\u0443\u0434\u043e\u0436\u0435\u0441\u0442\u0432\u0435\u043d\u043d\u044b\u0445 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0439\u00bb \u0440\u0430\u0441\u043f\u0443\u0441\u0442\u0438\u043b\u0438\u0441\u044c \u0432\u0441\u0435 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u044c\u0441\u043a\u0438\u0435 \u043e\u0440\u0433\u0430\u043d\u0438\u0437\u0430\u0446\u0438\u0438, \u043d\u0430 \u043c\u0435\u0441\u0442\u0435 \u043a\u043e\u0442\u043e\u0440\u044b\u0445 \u0441\u043e\u0437\u0434\u0430\u0451\u0442\u0441\u044f \u0435\u0434\u0438\u043d\u044b\u0439 <a href=\"https:\/\/ru.wikipedia.org\/wiki\/%D0%A1%D0%BE%D1%8E%D0%B7_%D0%BF%D0%B8%D1%81%D0%B0%D1%82%D0%B5%D0%BB%D0%B5%D0%B9_%D0%A1%D0%A1%D0%A1%D0%A0\" title=\"\u0421\u043e\u044e\u0437 \u043f\u0438\u0441\u0430\u0442\u0435\u043b\u0435\u0439 \u0421\u0421